import React from 'react';
import logo from './logo.svg';
import Topbar from './Components/Topbar';

import img from './Images/MichaelBurry.jpg';

function App() {
  return (
    <div >
      <Topbar />
      <img src = {img} />
    </div>
  );
}

export default App;
